import React from "react";
import useGitProjectCalculator from "../../container/gitprojects/gitProjectCalculator";
//
import GitLang from "./GitLang";
import { First } from "react-bootstrap/PageItem";
const LangGenerator: React.SFC = () => {
  const { gitLangFreq, isLoading } = useGitProjectCalculator();

  if (isLoading) {
    return <p>Loading</p>;
  }

  interface GitLangFreq {
    name: number;
  }

  interface GitCalc {
    gitLangs: Array<string>;
    gitLangFreq: GitLangFreq;
  }

  let gitLangs: Array<string> = gitLangFreq && Object.keys(gitLangFreq);
  let gitCalc: GitCalc = gitLangs && [gitLangs, gitLangFreq];

  return (
    <React.Fragment>
      {gitLangFreq &&
        gitCalc[0].map((item, index) => {
          return (
            <React.Fragment>
              <GitLang
                key={index}
                language={item[index]}
                ammount={item[index]}
              />
            </React.Fragment>
          );
        })}
    </React.Fragment>
  );
};

export default LangGenerator;
